# Print out normalized (scaled) stock prices
# all stock price will be divided by price form index 0 to get all the price on chart start from 1

def normalize(df) :
  x = df.copy()
  for i in x.columns[1:]:
    x[i] = x[i]/x[i][0]
  return x

normalize(stock_df)

